import React from 'react';
import OrderRow from './OrderRow';
import '../App.css';

function OrderTable({ items }) {
    return (
        <div>
            <table className = 'App-table'>
                <tr className='App-table-head'>
                    <th>Name</th>
                    <th>Price</th>
                    <th>Quantity</th>
                </tr>
                {items.map((item, i) => <OrderRow item={item} key={i} />)}
            </table>
        </div>
    );
}

export default OrderTable;
